import{_ as p,o as a,c as i,a as e}from"./app.53c4fa75.js";var b="/images/\u672C\u5730\u8C03\u7528.png",r="/images/\u8FDC\u7A0B\u8C03\u7528.png",o="/images/dubbo\u53D1\u5C55\u5386\u7A0B.png",d="/images/dubbo\u6CE8\u518C\u4E0E\u53D1\u73B0.png",l="/images/dubbo\u786E\u5B9A\u8C03\u7528\u5173\u7CFB.png",h="/images/\u8D1F\u8F7D\u5747\u8861.png",t="/images/\u8D1F\u8F7D\u5747\u8861\u968F\u673A\u5206\u914D\u7B56\u7565.png",n="/images/\u8D1F\u8F7D\u5747\u8861\u6743\u91CD\u5E73\u5747\u5206\u914D.png";const u={},s=e('<h1 id="dubbo\u6982\u8FF0" tabindex="-1"><a class="header-anchor" href="#dubbo\u6982\u8FF0" aria-hidden="true">#</a> Dubbo\u6982\u8FF0</h1><h2 id="\u4EC0\u4E48\u662Frpc" tabindex="-1"><a class="header-anchor" href="#\u4EC0\u4E48\u662Frpc" aria-hidden="true">#</a> \u4EC0\u4E48\u662FRPC</h2><p>RPC\u662FRemote Procedure Call\u7684\u7F29\u5199 \u7FFB\u8BD1\u4E3A:\u8FDC\u7A0B\u8FC7\u7A0B\u8C03\u7528</p><p>\u76EE\u6807\u662F\u4E3A\u4E86\u5B9E\u73B0\u4E24\u53F0(\u591A\u53F0)\u8BA1\u7B97\u673A\\\u670D\u52A1\u5668,\u4E92\u76F8\u8C03\u7528\u65B9\u6CD5\\\u901A\u4FE1\u7684\u89E3\u51B3\u65B9\u6848</p><p>RPC\u7684\u6982\u5FF5\u4E3B\u8981\u5B9A\u4E49\u4E86\u4E24\u90E8\u5206\u5185\u5BB9</p><p>1.\u5E8F\u5217\u5316\u534F\u8BAE</p><p>2.\u901A\u4FE1\u534F\u8BAE</p><p>\u4E3A\u4E86\u65B9\u4FBF\u5927\u5BB6\u7406\u89E3RPC,\u4E0B\u9762\u7684\u56FE\u7247\u5E2E\u52A9\u7406\u89E3</p><p><img src="'+b+'" alt="\u672C\u5730\u8C03\u7528.png"></p><p>\u4E0A\u9762\u56FE\u662F\u8001\u5A46\u548C\u8001\u516C\u5728\u5BB6\u7684\u65F6,\u8001\u5A46\u8BA9\u8001\u516C\u6D17\u7897\u7684\u8C03\u7528\u6D41\u7A0B</p><p>\u4F46\u8FD9\u4E2A\u6D41\u7A0B\u662F\u672C\u5730\u7684,</p><p>\u6211\u4EEC\u518D\u6362\u6210\u8FDC\u7A0B\u8C03\u7528\u7684\u56FE\u7247</p><p><img src="'+r+'" alt="\u8FDC\u7A0B\u8C03\u7528.png"></p><p><strong>\u901A\u4FE1\u534F\u8BAE</strong></p><p>\u901A\u4FE1\u534F\u8BAE\u6307\u7684\u5C31\u662F\u8FDC\u7A0B\u8C03\u7528\u7684\u901A\u4FE1\u65B9\u5F0F</p><p>\u518D\u4E0A\u9762\u56FE\u7247\u8C03\u7528\u4E2D,\u8001\u5A46\u4F7F\u7528\u624B\u673A\u4FE1\u606F\u7684\u65B9\u6CD5\u901A\u77E5\u8001\u516C\u53BB\u6D17\u7897</p><p>\u5B9E\u9645\u4E0A\u8FD9\u4E2A\u901A\u77E5\u7684\u65B9\u5F0F\u53EF\u4EE5\u6709\u591A\u79CD</p><p>\u4F8B\u5982:\u5199\u4FE1,\u98DE\u9E3D\u4F20\u4E66,\u95EA\u9001\u7B49\u7B49</p><p><strong>\u5E8F\u5217\u5316\u534F\u8BAE</strong></p><p>\u5E8F\u5217\u5316\u534F\u8BAE\u6307\u901A\u4FE1\u5185\u5BB9\u7684\u683C\u5F0F,\u53CC\u65B9\u90FD\u8981\u7406\u89E3\u8FD9\u4E2A\u683C\u5F0F</p><p>\u4E0A\u9762\u7684\u56FE\u7247\u4E2D,\u8001\u5A46\u7ED9\u8001\u516C\u53D1\u4FE1\u606F,\u4E00\u5B9A\u662F\u53CC\u65B9\u90FD\u80FD\u7406\u89E3\u7684\u4FE1\u606F</p><p>\u53D1\u9001\u4FE1\u606F\u662F\u5E8F\u5217\u5316\u8FC7\u7A0B,\u63A5\u6536\u4FE1\u606F\u9700\u8981\u53CD\u5E8F\u5217\u5316</p><h2 id="\u4EC0\u4E48\u662Fdubbo" tabindex="-1"><a class="header-anchor" href="#\u4EC0\u4E48\u662Fdubbo" aria-hidden="true">#</a> \u4EC0\u4E48\u662FDubbo</h2><p>\u7406\u89E3\u4E86RPC\u518D\u5B66\u4E60Dubbo\u5C31\u4F1A\u7B80\u5355\u4E00\u4E9B\u4E86</p><p>Dubbo\u662F\u4E00\u5957RPC\u6846\u67B6\u3002\u65E2\u7136\u662F\u6846\u67B6\uFF0C\u6211\u4EEC\u53EF\u4EE5\u5728\u6846\u67B6\u7ED3\u6784\u9AD8\u5EA6\uFF0C\u5B9A\u4E49Dubbo\u4E2D\u4F7F\u7528\u7684\u901A\u4FE1\u534F\u8BAE\uFF0C\u4F7F\u7528\u7684\u5E8F\u5217\u5316\u6846\u67B6\u6280\u672F\uFF0C\u800C\u6570\u636E\u683C\u5F0F\u7531Dubbo\u5B9A\u4E49\uFF0C\u6211\u4EEC\u8D1F\u8D23\u914D\u7F6E\u4E4B\u540E\u76F4\u63A5\u901A\u8FC7\u5BA2\u6237\u7AEF\u8C03\u7528\u670D\u52A1\u7AEF\u4EE3\u7801\u3002</p><p>\u7B80\u5355\u6765\u8BF4,Dubbo\u5C31\u662FRPC\u6982\u5FF5\u7684\u5B9E\u73B0</p><p>Dubbo\u662FSpring Cloud Alibaba\u63D0\u4F9B\u7684\u4E00\u4E2A\u6846\u67B6</p><p>\u80FD\u591F\u5B9E\u73B0\u5FAE\u670D\u52A1\u9879\u76EE\u7684\u4E92\u76F8\u8C03\u7528</p><h2 id="dubbo\u7684\u53D1\u5C55\u5386\u7A0B" tabindex="-1"><a class="header-anchor" href="#dubbo\u7684\u53D1\u5C55\u5386\u7A0B" aria-hidden="true">#</a> Dubbo\u7684\u53D1\u5C55\u5386\u7A0B</h2><p><img src="'+o+'" alt="dubbo\u53D1\u5C55\u5386\u7A0B.png"></p><p>2012\u5E74\u5E95dubbo\u505C\u6B62\u66F4\u65B0\u540E\u52302017\u5E74dubbo\u7EE7\u7EED\u66F4\u65B0\u4E4B\u524D</p><p>2015SpringCloud\u5F00\u59CB\u5174\u8D77,\u5F53\u65F6\u6CA1\u6709\u963F\u91CC\u7684\u6846\u67B6</p><p>\u56FD\u5185\u516C\u53F8\u8981\u4ECESpringCloud\u548CDubbo\u4E2D\u6289\u62E9\u4F7F\u7528\u54EA\u4E2A\u5FAE\u670D\u52A1\u65B9\u6848</p><p>\u57282012\u5E74dubbo\u505C\u6B62\u66F4\u65B0\u540E\u56FD\u5185\u7684\u5F53\u5F53\u7F51\u5728dubbo\u7684\u57FA\u7840\u4E0A\u5F00\u53D1\u4E86dubboX\u6846\u67B6,\u5E76\u8FDB\u884C\u7EF4\u62A4</p><p>2019\u5E74\u540E,SpringCloud\u548CDubbo\u624D\u80FD\u5171\u540C\u4F7F\u7528</p><h2 id="dubbo\u7684\u534F\u8BAE\u652F\u6301" tabindex="-1"><a class="header-anchor" href="#dubbo\u7684\u534F\u8BAE\u652F\u6301" aria-hidden="true">#</a> Dubbo\u7684\u534F\u8BAE\u652F\u6301</h2><p>RPC\u6846\u67B6\u5206\u901A\u4FE1\u534F\u8BAE\u548C\u5E8F\u5217\u5316\u534F\u8BAE</p><p>Dubbo\u6846\u67B6\u652F\u6301\u591A\u79CD\u901A\u4FE1\u534F\u8BAE\u548C\u5E8F\u5217\u5316\u534F\u8BAE,\u53EF\u4EE5\u901A\u8FC7\u914D\u7F6E\u6587\u4EF6\u8FDB\u884C\u4FEE\u6539</p><p>\u652F\u6301\u7684\u901A\u4FE1\u534F\u8BAE\u6709</p><ul><li>dubbo\u534F\u8BAE(\u9ED8\u8BA4)</li><li>rmi\u534F\u8BAE</li><li>hessian\u534F\u8BAE</li><li>http\u534F\u8BAE</li><li>webservice</li><li>.....</li></ul><p>\u652F\u6301\u7684\u5E8F\u5217\u5316\u534F\u8BAE</p><ul><li>hessian2(\u9ED8\u8BA4)</li><li>java\u5E8F\u5217\u5316</li><li>compactedjava</li><li>nativejava</li><li>fastjson</li><li>dubbo</li><li>fst</li><li>kryo</li></ul><p>Dubbo\u9ED8\u8BA4\u60C5\u51B5\u4E0B,\u534F\u8BAE\u7684\u7279\u5F81\u5982\u4E0B</p><ul><li>\u91C7\u7528NIO\u5355\u4E00\u957F\u8FDE\u63A5</li><li>\u4F18\u79C0\u7684\u5E76\u53D1\u6027\u80FD,\u4F46\u662F\u5927\u578B\u6587\u4EF6\u7684\u5904\u7406\u5DEE</li><li>Dubbo\u5F00\u53D1\u7B80\u5355,\u6709\u52A9\u4E8E\u63D0\u5347\u5F00\u53D1\u6548\u7387</li></ul><h2 id="dubbo\u670D\u52A1\u7684\u6CE8\u518C\u4E0E\u53D1\u73B0" tabindex="-1"><a class="header-anchor" href="#dubbo\u670D\u52A1\u7684\u6CE8\u518C\u4E0E\u53D1\u73B0" aria-hidden="true">#</a> Dubbo\u670D\u52A1\u7684\u6CE8\u518C\u4E0E\u53D1\u73B0</h2><p>\u5728Dubbo\u7684\u8C03\u7528\u8FC7\u7A0B\u4E2D,\u5FC5\u987B\u5305\u542B\u6CE8\u518C\u4E2D\u5FC3\u7684\u652F\u6301</p><p>\u6CE8\u518C\u4E2D\u5FC3\u63A8\u8350\u4F7F\u7528Nacos,\u4F46\u662F\u5982\u679C\u4F7F\u7528\u5176\u4ED6\u8F6F\u4EF6\u4E5F\u80FD\u5B9E\u73B0\u4F8B\u5982(Redis,zookeeper\u7B49)</p><p>\u670D\u52A1\u53D1\u73B0\uFF0C\u5373\u6D88\u8D39\u7AEF\u81EA\u52A8\u53D1\u73B0\u670D\u52A1\u5730\u5740\u5217\u8868\u7684\u80FD\u529B\uFF0C\u662F\u5FAE\u670D\u52A1\u6846\u67B6\u9700\u8981\u5177\u5907\u7684\u5173\u952E\u80FD\u529B\uFF0C\u501F\u52A9\u4E8E\u81EA\u52A8\u5316\u7684\u670D\u52A1\u53D1\u73B0\uFF0C\u5FAE\u670D\u52A1\u4E4B\u95F4\u53EF\u4EE5\u5728\u65E0\u9700\u611F\u77E5\u5BF9\u7AEF\u90E8\u7F72\u4F4D\u7F6E\u4E0E IP \u5730\u5740\u7684\u60C5\u51B5\u4E0B\u5B9E\u73B0\u901A\u4FE1\u3002</p><p>\u4E0A\u9762\u7684\u793A\u4F8B\u4E2D,\u8001\u5A46\u5C31\u662F\u670D\u52A1\u5668\u7684\u53D1\u73B0\u8005,\u5B83\u80FD\u591F\u83B7\u53D6\u8001\u516C\u7684\u6240\u6709\u529F\u80FD\u5217\u8868</p><p>\u8001\u5A46\u4E00\u65E6\u8C03\u7528\u516C\u7684\u670D\u52A1\u5C31\u5B8C\u6210\u4E86Dubbo\u7684\u8C03\u7528</p><p><img src="'+d+'" alt="dubbo\u6CE8\u518C\u4E0E\u53D1\u73B0.png"></p><p>consumer\u670D\u52A1\u7684\u6D88\u8D39\u8005,\u6307\u670D\u52A1\u7684\u8C03\u7528\u8005(\u4F7F\u7528\u8005)\u4E5F\u5C31\u662F\u8001\u5A46\u7684\u4F4D\u7F6E</p><p>provider\u670D\u52A1\u7684\u63D0\u4F9B\u8005,\u6307\u670D\u52A1\u7684\u62E5\u6709\u8005(\u751F\u4EA7\u8005)\u4E5F\u5C31\u662F\u8001\u516C\u7684\u4F4D\u7F6E</p><p>\u5728Dubbo\u4E2D,\u8FDC\u7A0B\u8C03\u7528\u4F9D\u636E\u662F\u670D\u52A1\u7684\u63D0\u4F9B\u8005\u5728Nacos\u4E2D\u6CE8\u518C\u7684\u670D\u52A1\u540D\u79F0</p><p>\u4E00\u4E2A\u670D\u52A1\u540D\u79F0,\u53EF\u80FD\u6709\u591A\u4E2A\u8FD0\u884C\u7684\u5B9E\u4F8B,\u4EFB\u4F55\u4E00\u4E2A\u7A7A\u95F2\u7684\u5B9E\u4F8B\u90FD\u53EF\u4EE5\u63D0\u4F9B\u670D\u52A1</p><blockquote><p>\u5E38\u89C1\u9762\u8BD5\u9898:Dubbo\u7684\u6CE8\u518C\u53D1\u73B0\u6D41\u7A0B</p></blockquote><p>1.\u9996\u5148\u670D\u52A1\u7684\u63D0\u4F9B\u8005\u542F\u52A8\u670D\u52A1\u5230\u6CE8\u518C\u4E2D\u5FC3\u6CE8\u518C,\u5305\u62EC\u5404\u79CDip\u7AEF\u53E3\u4FE1\u606F,Dubbo\u4F1A\u540C\u65F6\u6CE8\u518C\u8BE5\u9879\u76EE\u63D0\u4F9B\u7684\u8FDC\u7A0B\u8C03\u7528\u7684\u65B9\u6CD5</p><p>2.\u670D\u52A1\u7684\u6D88\u8D39\u8005(\u4F7F\u7528\u8005)\u6CE8\u518C\u5230\u6CE8\u518C\u4E2D\u5FC3,\u8BA2\u9605\u53D1\u73B0</p><p>3.\u5F53\u6709\u65B0\u7684\u8FDC\u7A0B\u8C03\u7528\u65B9\u6CD5\u6CE8\u518C\u5230\u6CE8\u518C\u4E2D\u5FC3\u65F6,\u6CE8\u518C\u4E2D\u5FC3\u4F1A\u901A\u77E5\u670D\u52A1\u7684\u6D88\u8D39\u8005\u6709\u54EA\u4E9B\u65B0\u7684\u65B9\u6CD5,\u5982\u4F55\u8C03\u7528\u7684\u4FE1\u606F</p><p>4.RPC\u8C03\u7528,\u5728\u4E0A\u9762\u6761\u4EF6\u6EE1\u8DB3\u7684\u60C5\u51B5\u4E0B,\u670D\u52A1\u7684\u8C03\u7528\u8005\u65E0\u9700\u77E5\u9053ip\u548C\u7AEF\u53E3\u53F7,\u53EA\u9700\u8981\u670D\u52A1\u540D\u79F0\u5C31\u53EF\u4EE5\u8C03\u7528\u5230\u670D\u52A1\u63D0\u4F9B\u8005\u7684\u65B9\u6CD5</p><h1 id="dubbo\u5B9E\u73B0\u5FAE\u670D\u52A1\u8C03\u7528" tabindex="-1"><a class="header-anchor" href="#dubbo\u5B9E\u73B0\u5FAE\u670D\u52A1\u8C03\u7528" aria-hidden="true">#</a> Dubbo\u5B9E\u73B0\u5FAE\u670D\u52A1\u8C03\u7528</h1><h2 id="\u786E\u5B9A\u8C03\u7528\u5173\u7CFB" tabindex="-1"><a class="header-anchor" href="#\u786E\u5B9A\u8C03\u7528\u5173\u7CFB" aria-hidden="true">#</a> \u786E\u5B9A\u8C03\u7528\u5173\u7CFB</h2><p><img src="'+l+'" alt="dubbo\u786E\u5B9A\u8C03\u7528\u5173\u7CFB.png"></p><p>\u5728\u4E0A\u9762\u7684\u6A21\u578B\u4E2D,\u4EE5order\u8C03\u7528stock\u51CF\u5C11\u5E93\u5B58\u7684\u4E1A\u52A1\u4E3E\u4F8B</p><p>order\u6A21\u5757\u662F\u6D88\u8D39\u8005stock\u6A21\u5757\u662F\u751F\u4EA7\u8005</p><p>\u5728\u4EE3\u7801\u8C03\u7528\u65F6,\u9996\u5148\u8981\u5BF9\u9879\u76EE\u8FDB\u884C\u5FC5\u8981\u7684\u914D\u7F6E</p><p>\u6211\u4EEC\u8C03\u7528\u65F6\u4E00\u822C\u4F1A\u5728\u6D88\u8D39\u8005\u9879\u76EE\u7684\u4EE3\u7801\u4E1A\u52A1\u903B\u8F91\u5C42\u4E2D,\u7F16\u5199\u8C03\u7528\u751F\u4EA7\u8005\u4E1A\u52A1\u903B\u8F91\u5C42\u65B9\u6CD5\u7684\u4EE3\u7801</p><p>\u8FD9\u6837\u505A\u7684\u597D\u5904</p><p>\u6211\u4EEC\u7684\u751F\u6210\u8005\u6B63\u5E38\u7F16\u5199mapper&gt;service&gt;controller\u8FD9\u4E2A\u5F00\u53D1\u6D41\u7A0B\u4E0D\u4F1A\u56E0\u4E3ADubbo\u7684\u4ECB\u5165\u800C\u53D8\u5316</p><h1 id="\u8D1F\u8F7D\u5747\u8861" tabindex="-1"><a class="header-anchor" href="#\u8D1F\u8F7D\u5747\u8861" aria-hidden="true">#</a> \u8D1F\u8F7D\u5747\u8861</h1><h2 id="\u4EC0\u4E48\u662F\u8D1F\u8F7D\u5747\u8861" tabindex="-1"><a class="header-anchor" href="#\u4EC0\u4E48\u662F\u8D1F\u8F7D\u5747\u8861" aria-hidden="true">#</a> \u4EC0\u4E48\u662F\u8D1F\u8F7D\u5747\u8861</h2><p><img src="'+h+'" alt="\u8D1F\u8F7D\u5747\u8861.png"></p><p>\u5728\u5B9E\u9645\u5F00\u53D1\u4E2D,\u4E00\u4E2A\u670D\u52A1\u57FA\u672C\u90FD\u662F\u96C6\u7FA4\u6A21\u5F0F\u7684,\u4E5F\u5C31\u662F\u591A\u4E2A\u529F\u80FD\u76F8\u540C\u7684\u9879\u76EE\u5728\u8FD0\u884C,\u8FD9\u6837\u624D\u80FD\u627F\u53D7\u66F4\u9AD8\u7684\u5E76\u53D1</p><p>\u8FD9\u65F6\u4E00\u4E2A\u8BF7\u6C42\u5230\u8FD9\u4E2A\u670D\u52A1,\u5C31\u9700\u8981\u786E\u5B9A\u8BBF\u95EE\u54EA\u4E00\u4E2A\u670D\u52A1\u5668</p><p>Dubbo\u6846\u67B6\u5185\u90E8\u652F\u6301\u8D1F\u8F7D\u5747\u8861\u7B97\u6CD5,\u80FD\u591F\u5C3D\u53EF\u80FD\u7684\u8BA9\u8BF7\u6C42\u5728\u76F8\u5BF9\u7A7A\u95F2\u7684\u670D\u52A1\u5668\u4E0A\u8FD0\u884C</p><p>\u6211\u4EEC\u8981\u5B9E\u73B0\u8BBE\u7F6E\u597D\u8D1F\u8F7D\u5747\u8861\u7684\u7B56\u7565\u7B97\u6CD5,\u5E76\u8BBE\u7F6E\u597D\u6BCF\u4E2A\u670D\u52A1\u5668\u7684\u8FD0\u884C\u6743\u91CD</p><p>\u624D\u80FD\u66F4\u597D\u7684\u5B9E\u73B0\u8D1F\u8F7D\u5747\u8861\u7684\u6548\u679C</p><p>Loadbalance:\u5C31\u662F\u8D1F\u8F7D\u5747\u8861\u7684\u610F\u601D</p><h2 id="dubbo\u5185\u7F6E\u8D1F\u8F7D\u5747\u8861\u7B56\u7565\u7B97\u6CD5" tabindex="-1"><a class="header-anchor" href="#dubbo\u5185\u7F6E\u8D1F\u8F7D\u5747\u8861\u7B56\u7565\u7B97\u6CD5" aria-hidden="true">#</a> Dubbo\u5185\u7F6E\u8D1F\u8F7D\u5747\u8861\u7B56\u7565\u7B97\u6CD5</h2><p>Dubbo\u5185\u7F6E4\u79CD\u8D1F\u8F7D\u5747\u8861\u7B97\u6CD5</p><ul><li><strong>random loadbalance:\u968F\u673A\u5206\u914D\u7B56\u7565(\u9ED8\u8BA4)</strong></li><li>round Robin Loadbalance:\u6743\u91CD\u5E73\u5747\u5206\u914D</li><li>leastactive Loadbalance:\u6D3B\u8DC3\u5EA6\u81EA\u52A8\u611F\u77E5\u5206\u914D</li><li>consistanthash Loadbalance:\u4E00\u81F4\u6027hash\u7B97\u6CD5\u5206\u914D</li></ul><p>\u5B9E\u9645\u8FD0\u884C\u8FC7\u7A0B\u4E2D,\u6BCF\u4E2A\u670D\u52A1\u5668\u6027\u80FD\u4E0D\u540C</p><p>\u5728\u8D1F\u8F7D\u5747\u8861\u65F6,\u90FD\u4F1A\u6709\u6027\u80FD\u6743\u91CD,\u8FD9\u4E9B\u7B56\u7565\u7B97\u6CD5\u90FD\u8003\u8651\u6743\u91CD\u95EE\u9898</p><h2 id="\u968F\u673A\u5206\u914D\u7B56\u7565-\u9ED8\u8BA4" tabindex="-1"><a class="header-anchor" href="#\u968F\u673A\u5206\u914D\u7B56\u7565-\u9ED8\u8BA4" aria-hidden="true">#</a> \u968F\u673A\u5206\u914D\u7B56\u7565(\u9ED8\u8BA4)</h2><p><img src="'+t+'" alt="\u8D1F\u8F7D\u5747\u8861\u968F\u673A\u5206\u914D\u7B56\u7565.png"></p><p>\u968F\u673A\u751F\u6210\u968F\u673A\u6570</p><p>\u5728\u54EA\u4E2A\u8303\u56F4\u5185\u8BA9\u54EA\u4E2A\u670D\u52A1\u5668\u8FD0\u884C</p><p>\u4F18\u70B9:</p><p>\u7B97\u6CD5\u7B80\u5355,\u6548\u7387\u9AD8,\u957F\u65F6\u95F4\u8FD0\u884C\u4E0B,\u4EFB\u52A1\u5206\u914D\u6BD4\u4F8B\u51C6\u786E</p><p>\u7F3A\u70B9:</p><p>\u5076\u7136\u6027\u9AD8,\u5982\u679C\u8FDE\u7EED\u7684\u51E0\u4E2A\u968F\u673A\u8BF7\u6C42\u53D1\u9001\u5230\u6027\u80FD\u5F31\u7684\u670D\u52A1\u5668,\u4F1A\u5BFC\u81F4\u5F02\u5E38\u751A\u81F3\u5B95\u673A</p><h2 id="\u6743\u91CD\u5E73\u5747\u5206\u914D" tabindex="-1"><a class="header-anchor" href="#\u6743\u91CD\u5E73\u5747\u5206\u914D" aria-hidden="true">#</a> \u6743\u91CD\u5E73\u5747\u5206\u914D</h2><p>\u5982\u679C\u51E0\u4E2A\u670D\u52A1\u5668\u6743\u91CD\u4E00\u81F4,\u90A3\u4E48\u5C31\u662F\u4F9D\u6B21\u8FD0\u884C</p><p>3\u4E2A\u670D\u52A1\u5668 1&gt;1 2&gt;2 3&gt;3 4&gt;1</p><p>\u4F46\u662F\u670D\u52A1\u5668\u7684\u6027\u80FD\u6743\u91CD\u4E00\u81F4\u7684\u53EF\u80FD\u6027\u5F88\u5C0F</p><p>\u6240\u4EE5\u6211\u4EEC\u9700\u8981\u6743\u91CD\u8BC4\u4EF7\u5206\u914D</p><p>Dubbo2.6.4\u4E4B\u524D\u5E73\u5747\u5206\u914D\u6743\u91CD\u7B97\u6CD5\u662F\u6709\u95EE\u9898\u7684</p><p>\u5982\u679C3\u4E2A\u670D\u52A1\u5668\u7684\u6743\u91CD\u6BD45:3:1</p><p>1&gt;1 2&gt;1 3&gt;1 4&gt;1 5&gt;1 6&gt;2 7&gt;2 8&gt;2 9&gt;3</p><p>10&gt;1</p><p>Dubbo2.7\u4E4B\u540E\u66F4\u65B0\u4E86\u8FD9\u4E2A\u7B97\u6CD5\u4F7F\u7528&quot;<strong>\u5E73\u6ED1\u52A0\u6743\u7B97\u6CD5</strong>&quot;\u4F18\u5316\u6743\u91CD\u5E73\u5747\u5206\u914D\u7B56\u7565</p><p><img src="'+n+'" alt="\u8D1F\u8F7D\u5747\u8861\u6743\u91CD\u5E73\u5747\u5206\u914D.png"></p><h2 id="\u6D3B\u8DC3\u5EA6\u81EA\u52A8\u611F\u77E5" tabindex="-1"><a class="header-anchor" href="#\u6D3B\u8DC3\u5EA6\u81EA\u52A8\u611F\u77E5" aria-hidden="true">#</a> \u6D3B\u8DC3\u5EA6\u81EA\u52A8\u611F\u77E5</h2><p>\u8BB0\u5F55\u6BCF\u4E2A\u670D\u52A1\u5668\u5904\u7406\u4E00\u6B21\u8BF7\u6C42\u7684\u65F6\u95F4</p><p>\u5B89\u88C5\u65F6\u95F4\u6BD4\u4F8B\u6765\u5206\u914D\u4EFB\u52A1\u6570,\u8FD0\u884C\u4E00\u6B21\u9700\u8981\u65F6\u95F4\u591A\u7684\u5206\u914D\u7684\u8BF7\u6C42\u6570\u8F83\u5C11</p><h2 id="\u4E00\u81F4\u6027hash\u7B97\u6CD5" tabindex="-1"><a class="header-anchor" href="#\u4E00\u81F4\u6027hash\u7B97\u6CD5" aria-hidden="true">#</a> \u4E00\u81F4\u6027Hash\u7B97\u6CD5</h2><p>\u6839\u636E\u8BF7\u6C42\u7684\u53C2\u6570\u8FDB\u884Chash\u8FD0\u7B97</p><p>\u4EE5\u540E\u6BCF\u6B21\u76F8\u540C\u53C2\u6570\u7684\u8BF7\u6C42\u90FD\u4F1A\u8BBF\u95EE\u56FA\u5B9A\u670D\u52A1\u5668</p><p>\u56E0\u4E3A\u6839\u636E\u53C2\u6570\u9009\u62E9\u670D\u52A1\u5668,\u4E0D\u80FD\u5E73\u5747\u5206\u914D\u5230\u6BCF\u53F0\u670D\u52A1\u5668\u4E0A</p><p>\u4F7F\u7528\u7684\u4E5F\u4E0D\u591A</p><h2 id="dubbo\u751F\u4EA7\u8005\u6D88\u8D39\u8005\u914D\u7F6E\u5C0F\u7ED3" tabindex="-1"><a class="header-anchor" href="#dubbo\u751F\u4EA7\u8005\u6D88\u8D39\u8005\u914D\u7F6E\u5C0F\u7ED3" aria-hidden="true">#</a> Dubbo\u751F\u4EA7\u8005\u6D88\u8D39\u8005\u914D\u7F6E\u5C0F\u7ED3</h2><p>Dubbo\u751F\u4EA7\u8005\u6D88\u8D39\u8005\u76F8\u540C\u7684\u914D\u7F6E</p><p>pom\u6587\u4EF6\u6DFB\u52A0dubbo\u4F9D\u8D56,yml\u6587\u4EF6\u914D\u7F6Edubbo\u4FE1\u606F</p><p><strong>\u751F\u4EA7\u8005</strong></p><ul><li><p>\u8981\u6709service\u63A5\u53E3\u9879\u76EE</p></li><li><p>\u63D0\u4F9B\u670D\u52A1\u7684\u4E1A\u52A1\u903B\u8F91\u5C42\u5B9E\u73B0\u7C7B\u8981\u6DFB\u52A0@DubboService\u6CE8\u89E3</p></li><li><p>SpringBoot\u542F\u52A8\u7C7B\u8981\u6DFB\u52A0@EnableDubbo\u6CE8\u89E3</p></li></ul><p><strong>\u6D88\u8D39\u8005</strong></p><ul><li>pom\u6587\u4EF6\u6DFB\u52A0\u6D88\u8D39\u6A21\u5757\u7684service\u4F9D\u8D56</li><li>\u4E1A\u52A1\u903B\u8F91\u5C42\u8FDC\u7A0B\u8C03\u7528\u524D\u5929\u6A21\u5757\u65F6\u4F7F\u7528@DubboReference\u6CE8\u89E3\u83B7\u53D6\u4E1A\u52A1\u903B\u8F91\u5C42\u5B9E\u73B0\u7C7B\u5BF9\u8C61</li></ul>',117),c=[s];function g(m,D){return a(),i("div",null,c)}var f=p(u,[["render",g],["__file","Dubbo.html.vue"]]);export{f as default};
